        <nav className="bg-white container relative flex flex-wrap items-center justify-between p-8 mx-auto lg:justify-between xl:px-0">
            <div className = "flex flex-wrap items-center justify-between w-full lg:w-auto">
                <span className= "flex items-start space-x-2 text-2xl font-medium text-indigo-500 dark:text-gray-100" >
                    <span className=''><NavLink to="/">Home</NavLink></span>
                    <span><NavLink to="/cart">Cart</NavLink></span>
                    <span><NavLink to="/login">Login</NavLink></span>
                    <span><NavLink to="/register">Register</NavLink></span>
                    <Search />
